wikitext.*:
#mw-head .icon [accesskey] {
    padding-top: 1.25em;
    height: 1.9em;
    width: 51px;
    background-position-x: 25px;
    color: transparent;
}

a[accesskey]:before {
    content: " " attr(accesskey) " ";
    text-transform: uppercase;
    white-space: pre;
    border: thin solid;
    margin-right: 0.5ex;
    color: #0645ad;
}
